function add(a,b){
    return (a+b);
}
function sub(a,b){
    return (a-b);
}
function mult(a,b){
    return (a*b);
}
function divide(a,b){
    var result = a/b;
    result = result.toFixed(2);
    return result;
}

export default add ;
export {sub,mult,divide};
